import { Component, OnInit } from '@angular/core';
import { GestorService } from 'src/app/services/gestor.service';
import Swal from 'sweetalert2';
import * as pdfMake from "pdfmake/build/pdfmake";
import * as pdfFonts from 'pdfmake/build/vfs_fonts';
import { style } from '@angular/animations';
@Component({
  selector: 'consultar-equipaje-vuelo',
  templateUrl: './consultar-equipaje-vuelo.component.html',
  styleUrls: ['./consultar-equipaje-vuelo.component.css']
})
export class ConsultarEquipajeVueloComponent implements OnInit {

  constructor(private GestorService: GestorService) { }
  verDatos=false;
  cargados=true;
  Datos1:any;
  Datos:any;
  n:any;

  ngOnInit(): void {
  }


  onReset(){
    this.verDatos=false;
    this.n='';
  }


  async onConsultarEquipaje(id:any){
    await this.GestorService.getDetalleEquipaje(id).toPromise().then(res => {
      this.verDatos = true;
      this.Datos1 = res;
      console.log(res)
    }).catch((err: any) => {
    });
    
  }



  createPDF(){
 
    let datosimp=[];
    datosimp.push([ 'Nombre del pasajero','Maleta','Peso'])
    for(let a=0;a<this.Datos.length;a++){
      datosimp.push([ this.Datos[a].nombre, this.Datos[a].maleta, this.Datos[a].peso])
    }
    const pdfDefinition: any = {
      content: [
        {
          
          image: 'data:image/jpeg;base64,',
          fit: [200, 200],
          style:'header'
        },{
          layout: 'lightHorizontalLines', // optional
          table: {
            // headers are automatically repeated if the table spans over multiple pages
            // you can declare how many rows should be treated as headers
            headerRows: 1,
            widths: [ 'auto','auto','auto'],
    
            body: datosimp,
            style:'header'
          }
        },
        
      ],
      styles: {
        header: {
          alignment: 'center'
        }
      }
      
    }

    const pdf = pdfMake.createPdf(pdfDefinition);
    pdf.download();
  }


}
